import Signin from '../pages/signin'
function home() {
 
  return (
      
 
    <div>
       <h1 className="display-4 fw-light lh-1 text-light"> Welcome to our Website </h1>
       <Link to="/" > <button type="button" class="btn btn-outline-light text-light  " >Sign In </button></Link>
       
       <Link to="/ChatPagesignin" > <button type="button" class="btn btn-outline-light text-light  " >Sign Up</button></Link>
    </div>
  )
}

export default home
